function getMockBookmarkData(folder_id) {
  if (folder_id != null) {
    for (var i = 0; i < mockBookmarks.length; ++i) {
      if (mockBookmarks[i].id == folder_id) {
        return mockBookmarks[i];
      }
    }
  }

  for (var i = 0; i < mockBookmarks.length; ++i) {
    if (mockBookmarks[i].root === true) {
      return mockBookmarks[i];
    }
  }

  // Shouldn't get here
  return null;
}

