PRESS_START_EVT = 'mousedown';
PRESS_STOP_EVT = 'mouseup';
PRESS_MOVE_EVT = 'mousemove';

// Override the send function and return the appropriate mock data.
window.chrome.send = function(funcName, opt_args) {
  if (funcName == 'getMostVisited') {
    setMostVisitedPages(mockPages, false, false);
  } else if (funcName == 'getRecentlyClosedTabs') {
    recentlyClosedTabs(mockRecents);
  } else if (funcName == 'getBookmarks') {
    if (opt_args && opt_args.length == 1) {
      bookmarks(getMockBookmarkData(opt_args[0]));
    } else {
      bookmarks(getMockBookmarkData(null));
    }
  } else if (funcName == 'getForeignSessions') {
    foreignSessions(mockForeignSessions);
    snapshots([]);
    setSyncEnabled(true);
  } else if (funcName == 'openForeignSession') {
    // Try to find the requested session in mock data
    mockForeignSessions.forEach(function(client) {
      client.forEach(function(win, winNum) {
        win.tabs.forEach(function(tab) {
          if (win.sessionTag == opt_args[0] &&
            winNum == opt_args[1] &&
            tab.sessionId == opt_args[2]) {
              window.location = tab.url;
          }
        });
      });
    });
  } else if (funcName == 'getRecommendedFaviconBgColor') {
    // use setTimeout to post to end of event queue, so the item can be inserted into doc.
    setTimeout(
        'recommendedFaviconBgColor(' + opt_args[1] + ', 255, 0, 0);', 0);
  }
};

